//不要な要素を取り除くか
var displayOnlyUploaded = true;
//表示可能なリスト
var visiblesList = [ "upload" , "image-clip", "advertise" ,"mylist-add","broadcast","number-of-view"];
//表示したい要素のクラス
var visibles = function(){
  var arr = [];
  var s = "";
  visiblesList.forEach(function(_e,_i,_a){
    var checkElem = document.getElementById(_e);
      //修正12/05
      docCookies.setItem(_e,"0");
      if(checkElem.checked ){
        docCookies.setItem(_e,"1");
        arr.push(_e);
      }
    s += _e+":"+checkElem.checked.toString()+"\n";
  });
  console.log(s);
  //alert(arr.join(","));
  //console.log(docCookies.getItem("upload"));
  arr = ["upload" , "image-clip", "advertise" ,"mylist-add","number-of-view"];
  return arr;
}
;
//自動で最後まで読み込むか
var autoReload = false;
//リロードの待ち時間（短い程効率的になるが，重たくなる）
var intervalTime = 100;
//コメントを表示するか
var displayComment = false;
var uiHtml = '<style type="text/css">#benza-ui{color:#FFF;width:60px;background: #1f1f1f;border: #1f1f1f solid 3px;border-radius: 3px;bottom:10px;right:10px;position:fixed;z-index: 999;}.ben-check{margin:0 auto;display:block;}</style>' +
'<div id="benza-ui"><p style="font-size: 20px;">Ben!<br></p><hr></div>';
(function () {
  //hyperCut();
  makeUI();
  main();
}) ();
function main() {
  if (autoReload) {
    var iv = setInterval(function () {
      if (!reload()) {
        hyperCut();
        clearInterval(iv);
      }
      hyperScroll();
    }, intervalTime + 10);
  } else {
    //常に回してると思いから何とかしよう

    setInterval(function () {
      //window.scrollTo( 0, 1500000);
      setTimeout(function () {
        hyperCut();
      }, 500);
    }, 1000);

  }
}


function hyperCut() {
  if (displayOnlyUploaded) {
    var tls = document.getElementsByClassName('timeline');
    for (var j = 0; j < tls.length; j++) {
      var elements = tls[j].children;
      //走査ルーチン
      for (var i = 0; i < elements.length; i++) {
        //メインの追出し
        if (!hyperMatch(elements[i].className, visibles())) {
          //elements[i].style.display = 'none';
          elements[i].parentNode.removeChild(elements[i]);
          //break;
        }
        //追加処理
        //console.log(elements.length);
        var contentsElem = elements[i].children[1].children;
        var whatDid = contentsElem[0];
        for(var k=0;k< contentsElem.length;k++){
          if(hyperMatch(contentsElem[k].className,["log-details"])){
            for(var l=0;l<contentsElem[k].children.length;l++){
              if(hyperMatch(contentsElem[k].children[l].className,["log-target-info"])){
                var title = contentsElem[k].children[l];
              }
              if(hyperMatch(contentsElem[k].children[l].className,["log-target-thumbnail"])){
                var thumbnail = contentsElem[k].children[l];
              }
            }
          }
        }
        //便利な変数群
        //elements[i]：リスト全体を囲む枠の直下
        //contentsElem：直下にwhatDidがある，whatDidの次は必ずしもtitleの入ったdivとは
        //     限らない（コメントが入って来る）のでtitleから昇るように
        //whatDid：「・・・投稿しました」
        //title：「【ゆっくり】してみた」など
        //thumbnail：サ胸
        
        if (true) {
          if(hyperMatch(whatDid.className,["log-body"])){
            title.parentNode.insertBefore(whatDid, title); 
          }
        }
        if (hyperMatch(elements[i].className, ["upload" ])) {
          elements[i].style.backgroundColor = '#EEF';
          title.style.fontSize = '150%';
          thumbnail.style.width = "200px";
          thumbnail.children[0].children[0].style.width  = "auto";
          thumbnail.children[0].children[0].style.height = "150px";
        }
        if (hyperMatch(elements[i].className, ["image-clip"])) {
          elements[i].style.backgroundColor = '#EFE';
          title.style.fontSize = '150%';
          thumbnail.style.width = "200px";
          thumbnail.children[0].children[0].style.width  = "auto";
          thumbnail.children[0].children[0].style.height = "150px";
        }
        if(!hyperMatch(elements[i].className, ["upload","image-clip"])){
          thumbnail.style.float = "right";
          title.style.marginLeft = "25px";
          thumbnail.parentElement.style.minHeight = "75px";
        }
      }
    }
  }
  if (!displayComment) {
    var lrs = document.getElementsByClassName('log-reslist');
    for (var i = 0; i < lrs.length; i++) {
      lrs[i].style.display = 'none';
      //console.log(lrs);
    }
  }
}
function hyperMatch(_sorceText, _serchArray) {
  for (var i = 0; i < _serchArray.length; i++) {
    var _serchRegExp = new RegExp(_serchArray[i], 'gi');
    if (_sorceText.match(_serchRegExp)) {
      //console.log("match!");
      return true;
    }
  }
  return false;
}
function reload() {
  var nextButton = document.getElementsByClassName('next-page-link')[0];
  if (!nextButton) {
    //console.log('stoped');
    return false;
  }
  if (!nextButton.parentNode.className.match(/loading/)) {
    nextButton.click();
    //console.log('fire!');
  } else {
    //console.log('Skipped because loading');
  }
  return true;
}
function hyperScroll() {
  //var loadingSign = document.getElementsByClassName("next-page-link")[0].parentNode;
  //while(loadingSign.className.match(/loading/)){
  //  console.log(loadingSign.className);
  //}
  setTimeout(function () {
    window.scrollTo(0, 1500000);
    //console.log('scrollTo');
  }, intervalTime);
}
function makeUI() {
  dc();ia();
  var writePoint = document.getElementsByTagName('body') [0];
  var uiBase = document.createElement('div');
  uiBase.innerHTML = uiHtml;
  writePoint.appendChild(uiBase);
  var frame = document.getElementById("benza-ui");
  visiblesList.forEach(function(_e,_i,_a){
    var checked = "";
    if(docCookies.getItem(_e)=="1"){checked = "checked"; }
    frame.innerHTML += '<p style="display: block; height: 30px;"><img style="float:left" width="20px" src=' + select64(_e) + '><input class="ben-check" type="checkbox" '+ checked + ' id="' + _e + '" ></p>';
  });
  //console.log('UI');
}

function select64(_str){
  var b64 = "";
  switch(_str){ 
    case  "upload"        :b64=b46ia[0]; break;
    case  "image-clip"    :b64=b46ia[1]; break;
    case  "advertise"     :b64=b46ia[2]; break;
    case  "mylist-add"    :b64=b46ia[3]; break;
    case  "broadcast"     :b64=b46ia[4]; break;
    case  "number-of-view":b64=b46ia[5]; break;
    default:break;
  }
  return b64;
}
function dc (){
  /*\
   |*|
   |*|  :: cookies.js ::
   |*|
   |*|  A complete cookies reader/writer framework with full unicode support.
   |*|
   |*|  https://developer.mozilla.org/en-US/docs/DOM/document.cookie
   |*|
   |*|  Syntaxes:
   |*|
   |*|  * docCookies.setItem(name, value[, end[, path[, domain[, secure]]]])
   |*|  * docCookies.getItem(name)
   |*|  * docCookies.removeItem(name[, path])
   |*|  * docCookies.hasItem(name)
   |*|  * docCookies.keys()
   |*|
   \*/
  docCookies = {
    getItem: function (sKey) {
      if (!sKey || !this.hasItem(sKey)) { return null; }
      return unescape(document.cookie.replace(new RegExp("(?:^|.*;\\s*)" + escape(sKey).replace(/[\-\.\+\*]/g, "\\$&") + "\\s*\\=\\s*((?:[^;](?!;))*[^;]?).*"), "$1"));
    },
    setItem: function (sKey, sValue, vEnd, sPath, sDomain, bSecure) {
      if (!sKey || /^(?:expires|max\-age|path|domain|secure)$/i.test(sKey)) { return; }
      var sExpires = "";
      if (vEnd) {
        switch (vEnd.constructor) {
          case Number:
            sExpires = vEnd === Infinity ? "; expires=Tue, 19 Jan 2038 03:14:07 GMT" : "; max-age=" + vEnd;
            break;
          case String:
            sExpires = "; expires=" + vEnd;
            break;
          case Date:
            sExpires = "; expires=" + vEnd.toGMTString();
            break;
        }
      }
      document.cookie = escape(sKey) + "=" + escape(sValue) + sExpires + (sDomain ? "; domain=" + sDomain : "") + (sPath ? "; path=" + sPath : "") + (bSecure ? "; secure" : "");
    },
    removeItem: function (sKey, sPath) {
      if (!sKey || !this.hasItem(sKey)) { return; }
      document.cookie = escape(sKey) + "=; expires=Thu, 01 Jan 1970 00:00:00 GMT" + (sPath ? "; path=" + sPath : "");
    },
    hasItem: function (sKey) {
      return (new RegExp("(?:^|;\\s*)" + escape(sKey).replace(/[\-\.\+\*]/g, "\\$&") + "\\s*\\=")).test(document.cookie);
    },
    keys: /* optional method: you can safely remove it! */ function () {
      var aKeys = document.cookie.replace(/((?:^|\s*;)[^\=]+)(?=;|$)|^\s*|\s*(?:\=[^;]*)?(?:\1|$)/g, "").split(/\s*(?:\=[^;]*)?;\s*/);
      for (var nIdx = 0; nIdx < aKeys.length; nIdx++) { aKeys[nIdx] = unescape(aKeys[nIdx]); }
      return aKeys;
    }
  };
}

